import React from "react";

function Carousel({ data }) {
  const { slides } = data;

  return (
    <div className="carousel">
      {slides.map((item, idx) => {
        return <img src={item.img} alt={item.alt} key={idx}></img>;
      })}
    </div>
  );
}

export default Carousel;
